 @RodrigoBCorrea  daqui 11 dias eu volto aqui pra rir da tua cara.
menos de um mes atras Botafogo quase meteu 5x2 no flamengo com um jogador a menos todo segundo tempo, amassamos Flamengo, Sao paulo, Corinthians, Atletico mineiro e Fluminense no Rio, qual foi a ultima vez que Atletico venceu o Botafogo no Rio de janeiro?
Outra coisa, sem tirar o merito do Atletico que realmente e muito forte no seu estadio, e jogou muito, mereceu vencer, mas o Botafogo fez um jogo muito abaixo do que ele costuma fazer em nivel tecnico e fisico,Atletico sobrou no segundo tempo, mas nao se engane,jogo nao vai ser tao facil como foi o de ida.
